import React from 'react'

const Notes = ({note, notes, setNotes, title, text, date}) =>{
    const removeHandler = () => {
        setNotes(notes.filter((el) => el.id !== note.id));
    };
    return(
       <div className="notes">
        <li className="note-item">
            <div>{title}</div>
            <span className="date">{date}</span>
            <button onClick={removeHandler}className="remove-btn">x</button> 
            <span className="text">{text}</span>
        </li>  
       </div>     
    );
}

export default Notes;
